import React from 'react';

const CabinetUsers = () => {
    return (
        <div className={'container'}>
            <table>
                <thead>
                    <tr>
                        <th>
                            Nickname
                        </th>
                        <th>
                            Name
                        </th>
                        <th>
                            Surname
                        </th>
                    </tr>
                </thead>
            </table>
        </div>
    );
};

export default CabinetUsers;
